description:
Shot by X-Art Co-founder Brigham Field - While the girls performed like the sex-crazed fashion models they are, this is the moment we knew we had to keep these two American girls all to ourselves. Aubrey and Jenna are both true bisexuals, but I think Aubrey leans even more towards the ladies. Although they are best friends, this is the first scene they ever did together. Aubrey did her first boy/girl sex scene ever for X-Art and she loved it, her first group for Colette.com - and we have another first coming up. You should have seen her face! Oh, don't worry you will, video and all! But in the meantime check this set produced and shot by Brig!


